initPage("作品集 - Zyreny","這裡有我的完整作品集，裡面有一些奇怪或有趣的網頁作品"),loadFonts(["Fira Code","Huninn","Noto Sans TC"]),loadNav([{id:"home",name:"首頁",href:"/"},{id:"contact",name:"聯絡",href:"/#Contact"}]);const API_URL="https://api.zyreny.com/data";async function fetchProjs(n){const t=await fetch(n),e=await t.json();let a=document.querySelector(".projs-list");a.innerHTML="";for(let n=0;n<e.length;n++){let t=e[n];a.innerHTML+=`\n        <a href="/${t.name}" class="proj">\n            <div>\n                <img src="/assets/img/projs/${t.name}.webp" alt="${t.title}" loading="lazy">\n                <h2>${t.title}</h2>\n                <p>${t.desc}</p>\n            </div>\n        </a>`}}fetchProjs(`${API_URL}/projs/list`);